import './App.css';
import  Chessboard2  from './Components/Chessboard2.jsx';
import io from 'socket.io-client';
import { Client } from '@stomp/stompjs';

export default function App() {

  const socket = io.connect('ws://localhost:8080/ws');
  const stompClient = new Client({
    webSocketFactory: () => socket,
    debug: (str) => {
        console.log(str);
    },
});

stompClient.onConnect = (frame) => {
    console.log('Connected: ' + frame);

    // Subscribe to a topic
    stompClient.subscribe('/topic/some-topic', (message) => {
        console.log('Received message: ', message.body);
    });

    // Send a message to the server
    stompClient.publish({
        destination: "/app/some-destination",
        body: JSON.stringify({ content: 'Hello, server!' })
    });
};

stompClient.activate();
  return (
    <div>
      <Chessboard2 />
    </div>
  );
}
